import React from "react";
import PageNotFound from "../Pages/PageNotFound";
import Home from "../Pages/Home";
import About from "./Pages/about";
import Users from "./Pages/Users";


const routes = {
  "/": () => <Home />,
  "/user": () => <Users />,
  "/about": () => <About />
};

export default routes;
